import React, { Component } from 'react';
class NotesPage extends Component {
    state = {
        notes: null

    }
    componentDidMount() {
        this.setState({ notes: this.props.notes })
    }
    render() {
        return (
            <React.Fragment>
                <h1>Notes</h1>
                {this.state.notes.map(x => (
                    <p key={x._id}>
                        {x.text}
                    </p>
                ))}
            </React.Fragment>
        );
    }
}

export default NotesPage;
